import React, {Component} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";

export default class CreateTodo extends Component {

    constructor(props) {
        super(props);

        this.onChangeEtat = this.onChangeEtat.bind(this);
        this.onChangeCategorie = this.onChangeCategorie.bind(this);
        this.onChangeNom = this.onChangeNom.bind(this);
        this.onChangePrix = this.onChangePrix.bind(this);
        this.onChangeInfo = this.onChangeInfo.bind(this);
        this.onChangeContact = this.onChangeContact.bind(this);
        
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            etat: '',
            categorie: '',
            nom: '',
            prix: '',
            info: '',
            contact: '',
        }
    }

    onChangeEtat(e) {
        this.setState({
            etat: e.target.value
        });
    }

    onChangeCategorie(e) {
      this.setState({
          categorie: e.target.value
      });
  }

    onChangeNom(e) {
        this.setState({
            nom: e.target.value
        });
    }

    onChangePrix(e) {
      this.setState({
          prix: e.target.value
      });
  }

  onChangeInfo(e) {
    this.setState({
        info: e.target.value
    });
    
}


onChangeContact(e) {
  this.setState({
      contact: e.target.value
  });

   
}
    onSubmit(e) {
      
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`Etat: ${this.state.etat}`);
        console.log(`Categorie: ${this.state.categorie}`);
        console.log(`Nom: ${this.state.nom}`);
        console.log(`Prix: ${this.state.prix}`);
        console.log(`Info: ${this.state.info}`);
        console.log(`Contact: ${this.state.contact}`);

        this.setState({
            etat: '',
            categorie: '',
            nom: '',
            prix: '',
            info: '',
            contact: '',
        });
    }

    render() {
        return (

          
            <div className="container   col-md-6 mt-1" style={{marginTop: 20}}>
                <h3 className="text-center mt-2">Créer une enchère</h3>
                <form onSubmit={this.onSubmit} >

                    <div class="form-group text-blue col-md-6">
                        <label>Etat du produit: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.etat}
                                onChange={this.onChangeEtat}
  
                               />
                    </div>

                    <div class="form-group text-blue col-md-6">
                        <label>Categorie: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.categorie}
                                onChange={this.onChangeCategorie}
  
                                />
                    </div>
                    <div class="form-group text-blue col-md-9">
                        <label>Nom: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.nom}
                                onChange={this.onChangeNom}
                                />
                    </div>


                    <div class="form-group text-blue col-md-3">
                        <label>Prix (€): </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.prix}
                                onChange={this.onChangePrix}
                                />
                    </div>



                    <div class="form-group text-blue col-md-12  " >
                        <label>Détails: </label>
                        <textarea 
                                type="text" 
                                className="form-control"
                                value={this.state.info}
                                onChange={this.onChangeInfo}
                                rows = "5"
                                
                                />
                    </div>


                    <div class="form-group text-blue col-md-9">
                        <label>Contact: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.contact}
                                onChange={this.onChangeContact}
  
                               />
                    </div>

                    

                    
                   
                    <div className="form-group col-md-6">
                        <input type="submit" value="Valider la création" className="btn btn-warning " />
                    </div>
                </form>
            </div>

            
        )
    }
}
